import React from 'react';

const styles = {
  footer: {
    display: 'flex',
    flexWrap: 'wrap',
    height: '100%',
  }
};

export default function Footer() {
  return (
    <div style={styles.footer}>
      <h1>Footer</h1>
      <p>
      Hey
      </p>
    </div>
  );
}
